import {
  Button,
  Container,
  InputLabel,
  Paper,
  TextField,
  Typography,
} from "@mui/material";
import { useState } from "react";

const PrimeNumbersView = (): JSX.Element => {
  const [upperBound, setUpperBound] = useState("");
  const [responseData, setResponseData] = useState([]);

  const handleSubmit = async (event: { preventDefault: () => void }) => {
    event.preventDefault();
    const url = "http://localhost:8080/primes/" + upperBound;
    //try fetch
    fetch(url)
      .then((response) => response.json())
      .then((data) => {
        setResponseData(data);
      })
      .catch((error) => {
        console.error("There was an error!", error);
      });
  };

  return (
    <form onSubmit={handleSubmit}>
      <Typography align="center" variant="h4" sx={{ margin: "0.5em" }}>
        Generate Prime Numbers
      </Typography>
      <Paper sx={{ margin: "auto", width: "50%", padding: "2em" }}>
        <Container maxWidth="sm">
          <InputLabel htmlFor="upperBound">
            Enter a number to generate a list of prime numbers between 0 and the
            number.
          </InputLabel>
          <TextField
            fullWidth
            id="upperBound"
            label="Number"
            type="text"
            name="upperBound"
            onChange={(e): void => setUpperBound(e.target.value)}
            InputLabelProps={{
              shrink: true,
            }}
          />
          {/* <input type="text" name="upperBound" onChange={(e) :void  => setUpperBound(e.target.value)}/> */}
          <Button type="submit" variant="contained" sx={{ marginTop: "1em" }}>
            Generate
          </Button>
          <ul>
            {responseData.map((item, index) => {
              return <li key={index}>{item}</li>;
            })}
          </ul>
        </Container>
      </Paper>
    </form>
  );
};
export default PrimeNumbersView;
